import React from 'react'
import './Footer.css'

class Footer extends React.Component{
    render(){
        return (
            <div className="footerBar">

            <div className="containerItems">
            <div className="footerItems"><p>item 1</p></div>
            <div className="footerItems"><p>item 2</p></div>
            <div className="footerItems"><p>item 3</p></div>
            <div className="footerItems">
            <p>CopyRight Release 2021</p>
            </div>
            </div>
            </div>  
        )
    }
}

export default Footer;
